const Footer = () => {
    return ( 
        <footer>
            <div className="footer-in">
            <div className="footer-in-lower">
                <p>Designed and Developer by <a href="https://dineshkorukonda.in">Dinesh Korukonda</a> | All Rights Reservesd</p>
            </div>
            </div>
        </footer>
     );
}

export default Footer;
